import React from 'react';
import './Skills.css';
import HTML from '../assets/HTML5.png';
import CSS from '../assets/CSS3.png';
import JS from '../assets/JavaScript.png';
import Rct from '../assets/React.png';
// import Gtb from '../assets/Github.png';
import VS from '../assets/VSCode.png';

function Skills() {
    const skills = [
        {name: 'HTML', level: 85, icon: HTML},
        {name: 'CSS', level: 80, icon: CSS},
        {name: 'JavaScript', level: 60, icon: JS},
        {name: 'React', level: 50, icon: Rct},
        // {name: 'Github', level: 40, icon: Gtb},
        {name: 'VS Code', level: 75, icon: VS}
    ];

    return(
        <section className='skills'>
            <h2>Skills & Technologies</h2>
            <div className='skills-container'>
                {skills.map((skill, index) => (
                    <div className='skill' key={index}>
                        <div className='skill-header'>
                            <div className='skill-icon-label'>
                                <span className='icon'>{skill.icon}</span>
                                <span>{skill.name}</span>
                            </div>
                            <span>{skill.level}%</span>
                        </div>
                        <div className='progress-bar'>
                            <div className='progress' style={{width: `${skill.level}%`}}></div>
                        </div>
                    </div>
                ))}
            </div>
        </section>
    );
}

export default Skills;
